import React from 'react';
import './style.css'
import { Card } from 'react-bootstrap';

const Check = () => {
    return(
        <div>
            <h1>PLAGIARISM CHECKER</h1>
            <div className="row">
                <div className="col-sm-8">
                    <Card className="textWrapper">
                        <Card.Body></Card.Body>
                    </Card>
                </div>
                <div>
                    <button>CHECK PLAGIARISME</button>
                    <button>CENCEL</button>
                </div>
            </div>
        </div>
    )
}

export default Check;
